import React, { Component } from 'react'

import "./Home.css";
import CardSection from "../Components/CardSection";
import SmCardSection from "../Components/SmCardSection";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        {/* Hero Component */}
        <div className="heroSection">
          <div className="hero-content">
            <div className="hero-title">
              Bring Idea to Real
          </div>

            <h2>
              Full-stack product designer with front-end
              skills, HTML, CSS, JavaScript,React, and React Native. 
           </h2>
           <h2>
              Previous Work at: Wish
           </h2>
            {/* <button>Contact</button> */}
          </div>
        </div>

        {/* Projects Section */}
        < CardSection />


        {/* Open Design Section/ Cards */}
        <SmCardSection />

        {/* Footer */}

      </div>
    );
  }
}

export default Home;
